snippet.description:
제가 가끔 타는 저희 회사차를 한번쯤 공개해야 할 것 같아서 찍었습니다.

그런데 포르쉐코리아의 시승차가 저희 회사 차와 색상이 똑같아서 좀 짜증납니다. ^^;; 

요즘 너어어어어무 더워서 이번엔 밤에 찍었구요. 

포르쉐는 차량 가격이 다가 아니고, 옵션이 돈을 엄청나게 빨아먹는 다는걸 아실 수 있을겁니다. ^^;; 

* 의견은 댓글로 남겨주시기 보다 커뮤니티 http://c.motorgraph.com/ 으로  오셔서 적어 주시면 고맙겠습니다. 
* 시승기 영상은 케이블 TV VOD 로도 볼 수 있습니다.
